import React, { useEffect, useState } from 'react';
import './App.css';
import Header from './components/Header';
import Navigation from './components/Navigation';
import PlayerProfile from './components/PlayerProfile';
import QuestLog from './components/QuestLog';
import CareerCampaign from './components/CareerCampaign';
import TrainingAcademy from './components/TrainingAcademy';
import SkillTree from './components/SkillTree';
import DeveloperLogs from './components/DeveloperLogs';
import GuildChannels from './components/GuildChannels';
import ParticleBackground from './components/ParticleBackground';

function App() {
  const [activeSection, setActiveSection] = useState('about');

  useEffect(() => {
    // Update active section based on scroll position
    const handleScroll = () => {
      const sections = ['about', 'projects', 'experience', 'skills', 'blog', 'contact'];
      const scrollPosition = window.scrollY + 150;

      for (const sectionId of sections) {
        const element = document.getElementById(sectionId);
        if (element) {
          const sectionTop = element.offsetTop;
          const sectionHeight = element.offsetHeight;

          if (scrollPosition >= sectionTop && scrollPosition < sectionTop + sectionHeight) {
            setActiveSection(sectionId);
            break;
          }
        }
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <div className="App gaming-theme" data-color-scheme="dark">
      <ParticleBackground />

      {/* Fixed Sidebar */}
      <aside className="sidebar">
        <div className="sidebar-content">
          <div className="profile-section">
            <div className="profile-image">
              <div className="profile-placeholder">VK</div>
            </div>
            <h2 className="profile-name">Vnsh Kumar</h2>
            <p className="profile-title">Senior Game Developer</p>
            <p className="profile-email">vnsh.kumar@email.com</p>
            <p className="profile-location">📍 Gurgaon, IN</p>
            <button className="contact-btn" onClick={() => document.getElementById('contact').scrollIntoView({ behavior: 'smooth' })}>
              Contact Me
            </button>
          </div>

          <div className="sidebar-footer">
            <p className="copyright">© 2024 Vnsh Kumar, All Rights Reserved.</p>
          </div>
        </div>
      </aside>

      {/* Main Content */}
      <main className="main-content">
        <PlayerProfile />
        <QuestLog />
        <CareerCampaign />
        <TrainingAcademy />
        <SkillTree />
        <DeveloperLogs />
        <GuildChannels />

        {/* Bottom Navigation */}
        <nav className="bottom-nav">
          <div className="nav-dots">
            <button 
              className={`nav-dot ${activeSection === 'about' ? 'active' : ''}`}
              onClick={() => setActiveSection('about')}
            >
              <span className="nav-icon">🏠</span>
            </button>
            <button 
              className={`nav-dot ${activeSection === 'projects' ? 'active' : ''}`}
              onClick={() => setActiveSection('projects')}
            >
              <span className="nav-icon">📁</span>
            </button>
            <button 
              className={`nav-dot ${activeSection === 'experience' ? 'active' : ''}`}
              onClick={() => setActiveSection('experience')}
            >
              <span className="nav-icon">💼</span>
            </button>
            <button 
              className={`nav-dot ${activeSection === 'skills' ? 'active' : ''}`}
              onClick={() => setActiveSection('skills')}
            >
              <span className="nav-icon">⚡</span>
            </button>
            <button 
              className={`nav-dot ${activeSection === 'blog' ? 'active' : ''}`}
              onClick={() => setActiveSection('blog')}
            >
              <span className="nav-icon">📝</span>
            </button>
            <button 
              className={`nav-dot ${activeSection === 'contact' ? 'active' : ''}`}
              onClick={() => setActiveSection('contact')}
            >
              <span className="nav-icon">✉️</span>
            </button>
          </div>
        </nav>
      </main>
    </div>
  );
}

export default App;
